import React, { useState } from 'react'
import './Message.css';

export default function Message(){


    const [inputdata, Setinputdata]=useState({
        sender:"",
        message:""
    })


    function changehandle(e){
            
        Setinputdata({...inputdata,[e.target.name]:e.target.value})
    }
    return(
        <>
        <div className='msginput'>
            <input type="text" placeholder='Sender...' name="sender" value={inputdata.sender} onChange={changehandle}/> <br/>
            <input type="text" name="msg" placeholder='Message...' value={inputdata.message} onChange={changehandle}/>
        </div>
        </>
    )
}
